import React, { Component } from 'react';

class Footer extends Component{
    render() {
      return 
        <div className="footer">
            <p>京ICP备14023220号 | 京公网安备11010502031492 | 火星地产电子商务有限公司 © 2014-2018 All Rights Reserved</p>
        </div>
    }
}

export default Footer;
